import React from 'react';
import Header from "./Header";
import AuthorizationForm from "./AuthorizationForm";

function Register() {
    return (
        <>
         <Header linkTitle="Log in" pageLink="./login" />
         <AuthorizationForm title="Sign up" buttonTitle="Sign up" pageLink="./login" pageLinkTitle="Already a member? Log in here!" onAuthorizationSubmit={props.handleAuthorizationSubmit} />
        </>
    );
}

export default Register;
